        "state":"ME,WV",
        "sdate":"2020-01",
        "edate":"2020-01",
        "elems":[{
            "name":"pcpn",
            "interval":[0,1],
            "duration":1,
            "reduce":"sum"
        }],
        "output":"gif"
    },
    updateInputParams: () => {},
});

